import Footer from "./components/Footer.jsx";
import Navbar from "./components/Navbar.jsx";
import Welcome from"./components/Welcom.jsx";
// import FindOwner from "./components/Owners.jsx"
import Verter from "./components/Veter.jsx";
// import AddOwner from "./components/AddOwner.jsx";
import Result from "./components/Result.jsx";
import Update from "./components/UpdateOwner.jsx";
import AddAnimal from "./components/AddPet.jsx";
import OwnerList from "./components/OwnerList.jsx";
import OwnerInfo from "./components/OwnerInfo.jsx";
import UpDatePet from "./components/UpDatePet.jsx";
import VisitPet from "./components/VisitPet.jsx";
import AddPet from "./components/AddPet.jsx";
import UpdateOwner from "./components/UpdateOwner.jsx";
import {RouterProvider, createBrowserRouter} from "react-router-dom";
import Owners from "./components/pages/owners/Owners.jsx";
import Create from "./components/pages/owners/components/Create.jsx";



function App() {
    const router = createBrowserRouter([
        {
            path:"/",
            element:<Welcome/>
        },
        {
            path:"/Home",
            element:<Welcome/>
        },
        {
            path:"/owners",
            element:<Owners/>
        },
        {
            path:"/VETERINARIANS",
            element:<Verter/>
        },
        {
            path:"/owner/create",
            element:<Create />
        },
        {
            path:"/FindOwner",
            element:<OwnerInfo/>
        },
        {
            path:"/UpdateOwner",
            element:<UpdateOwner/>
        },
        {
            path:"/AddPet",
            element:<AddPet/>
        },
        {
            path:"/AddVisit",
            element:<VisitPet/>
        },
        {
            path:"/UpdatePet",
            element:<UpDatePet/>
        },
        {
            path:"/OwnerInfo",
            element:<OwnerInfo/>
        },
        {
            path:"/owner/:id",
            element:<Result/>
        },
    ])

    const router_ = createBrowserRouter([
        {
            path:"/",
            element:<Welcome/>
        }
    ])


    return (

    // <div className="App">
    //     <Navbar />
    //         <RouterProvider router={router}></RouterProvider>
    //     <Footer />
    // </div>

        <div className="App">
            <Navbar />
                <RouterProvider router={router}></RouterProvider>
            <Footer />
        </div>
    );
}

export default App
